import MovieList from './comp/MovieList'
import './style.css'

import {useState} from 'react'

function App() {
  const [num, setNum] = useState(2)

  function rise() {
    setNum(num + 1)
  }

  return (
    <div className="main">
      <div className="container">
        <MovieList />
      </div>
    </div>
  );
}

export default App;
